export const weekArray = ["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"];

export const gridArray = _.range(0, 42);

export const yearOptions = ["2021", "2022", "2023", "2024"];

export const monthOptions = [
  "1",
  "2",
  "3",
  "4",
  "5",
  "6",
  "7",
